import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import TelaInformacoes from './telas/TelaInformacoes';
import App from './telas/App'
import { createBrowserRouter, RouterProvider } from 'react-router-dom';
import TelaBusca from './telas/TelaBusca';
import TelaEstante from './telas/TelaEstante';
import TelaAndar from './telas/Andar/TelaAndar';

const router = createBrowserRouter([{
  path: "/",
  element: <App />,

  children:[
  {
    path: "/",
    element: <TelaBusca />
  },
  {
    path: "book",
    element: <TelaInformacoes />
  },
  {
    path: "map",
    element: <TelaEstante />
  },
  {
    path: "map/floor",
    element: <TelaAndar />
  }
  ],
},]);
const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <RouterProvider router={router}/>
  </React.StrictMode>
);
